import React from 'react';

class MovieList extends React.Component {
    render() {
        return ( 
                <div className="row">
                    <div className="col-log-4">
                        <div className="card mb*4 shadow-sm">
                            <img src="pictures1.jpg" alt=".."/>
                        </div>
                    </div>
                </div>
            
        )
    }
}

export default MovieList;
